export default function About() {
    return (
      <div className="about-div">
        <h1>About ME Page</h1>
        <p>
        Beginner Web Developer. I like to always explore the unknown with curiosity while maintaining an analytical mindset. I am passionate about creating things.
        </p>
        <p></p>
      </div>
    );
  }
